text:
1.	Manusia tidak mungkin mengenal Allah jika Allah tidak menyatakan/menunjukkan diriNya; Dan pastilah keliru jika usaha manusia mengenal/mencari Allah, lagi pula manusia tdk akan mampu melihat Allah jika Allah memperlihatkan diriNya; Tapi Allah lah yang harus menyatakan diriNya agar dapat dilihat manusia; Allah pernah menyatakan diriNya (theofani) kepada Abraham dalam rupa manusia (Kejadian 18;1-2); Allah pernah menampakkan diri kepada Yakub juga dalam rupa manusia (Kejadian 32;24-28); Allah pernah menyatakan diriNya kepada Musa dalam bentuk api di semak belukar ( Keluaran 3;4-6); Firman Allah menjadi manusia yaitu Tuhan Yesus eksis di bumi; Roh Kudus pernah menyatakan diri kepada murid2 dalam bentuk lidah2 api; Kisah para Rasul 2;3-4); Jadi Trinitas lengkap pernah menyatakan diriNya dibumi; Jadi orang Kristen tidak mungkin keliru siapa Allahnya; Tapi tiba2 abad ke 7, alloh sama sekali tidak pernah menyatakan dirinya, bahkan kepada muhamad alooh tdk pernah memperkenlakan dirinya, Cuma lewat Jibril. Jadi sepertinya memang alloh kayaknya tidak ada;mohon maaf;Gbu
2.	HANYA ALLAH YANG BOLEH MENGAMPUNI DOSA; Tetapi Yesus mengampuni dosa seorang yang lumpuh hanya dengan mengatakan:â€Hai anakku Dosamu sudah diampuniâ€ (Markus 2;5); Hal itu Cukup untuk membuktikan bahwa Yesus adalah Firman Bapa yang jadi manusia  (TUHAN);Carilah banyak ayat bahwa Yesus adalah Tuhan, mis Yoh 13;13; Wahyu 1;8.Wahyu 21;6; wahyu 22;13 dll;
3.	Segeralah terima Yesus saudaraku dan berikan dirimu diampuni, sebab tidak ada pengampunan dosa tanpa penumpahan darah,; Penumpahan Darah Yesus telah menyelesaikan segala dosa satu kali untuk semua dan selamanya, sebab dalam darah lah ada nyawa, sehingga nyawa harus dibayar nyawa; Perbuatan baik/amal tidak bisa bayar nyawa, sebab tidak adil, tidak seimbang dan tidak aple to aple; Lagi pula Allah Maha Adil, sehingga Allah tidak mengampuni dosa begitu saja, tapi ada hukuman pengganti (kurban); Tapi setelah menjadi murid Yesus, maka pastilah berbuah dengan berbuat baik dan utk menentukan mahkotamu di sorga kelak; Gbu
